        <p className="product__price">
          <strong>$14.89</strong>
        </p>
        <div className="product__rating"></div>

        <img
          src="https://images-na.ssl-images-amazon.com/images/I/511qyzBH42L._SX322_BO1,204,203,200_.jpg"
          alt=""
        />
      </div>
    </div>
  );
}

export default Product;
